import React from 'react';
import {  Link } from "react-router-dom";

const Navbar = () => {
  return (

    <div class = "flex flex-row">
        <Link to="/">Home</Link>
        <Link to="/exp">Experience</Link>
        <Link to="/contact">Contact</Link>    
    </div>

  );
}

export default Navbar;
